//Practice Code
function Car(props) {
  return <h2>I am a {props.size} Car!</h2>;
}
const x = 51;

const myElement = <h1>{(x) < 10 ? "Hello" : "Goodbye"}</h1>;

const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);
root.render(<Car color="red"/>);

